  false,\n\t\"url\": null,\n\t\"notes\": \"Terrain data, as defined in FEMA Guidelines
  and Specifications, Appendix M: Data Capture Standards, describes the digital topographic
  data that were used to create the elevation data representing the terrain environment
  of a watershed and/or floodplain. Terrain data requirements allow for flexibility
  in the types of information provided as sources used to produce final terrain deliverables.
  Once this type of data is provided, FEMA will be able to account for the origins
  of the flood study elevation data. (Source: FEMA Guidelines and Specifications,
  Appendix M, Section N.1.2).\",\n\t\"owner_org\": \"ae816746-a815-4a3f-805d-2b51b561c626\",\n\t\"extras\":
